import css from './Customers.module.css';
import { Swiper, SwiperSlide } from 'swiper/react';

// Import Swiper styles
import 'swiper/css';
import 'swiper/css/pagination';

// import required modules
import { Navigation } from 'swiper/modules';
import { useRef } from 'react';

export default function Customers() {
  const prevRef = useRef(null);
  const nextRef = useRef(null);
  return (
    <section className={css.customersSection}>
      <div className="section-title">Our customers really love us</div>

      <p className={css.customersText}>
        Their only complaint? Not finding us sooner. See why our customers
        choose StellarLikes for all of their Instagram-related growth needs.
      </p>

      <div className="swiper-container">
        <div className="swiper-navigation">
          <button ref={prevRef} className="swiper-button-prev">
            ← Prev
          </button>
          <button ref={nextRef} className="swiper-button-next">
            Next →
          </button>
        </div>
        <Swiper
          slidesPerView={3}
          spaceBetween={30}
          navigation={{
            prevEl: prevRef.current,
            nextEl: nextRef.current,
          }}
          onBeforeInit={swiper => {
            swiper.params.navigation.prevEl = prevRef.current;
            swiper.params.navigation.nextEl = nextRef.current;
          }}
          modules={[Navigation]}
          loop={true}
          breakpoints={{
            640: {
              slidesPerView: 1,
              spaceBetween: 20,
            },
            768: {
              slidesPerView: 2,
              spaceBetween: 30,
            },
            1024: {
              slidesPerView: 3,
              spaceBetween: 30,
            },
          }}
          className="mySwiper"
        >
          <SwiperSlide>Slide 1</SwiperSlide>
          <SwiperSlide>Slide 2</SwiperSlide>
          <SwiperSlide>Slide 3</SwiperSlide>
          <SwiperSlide>Slide 4</SwiperSlide>
          <SwiperSlide>Slide 5</SwiperSlide>
          <SwiperSlide>Slide 6</SwiperSlide>
          <SwiperSlide>Slide 7</SwiperSlide>
          <SwiperSlide>Slide 8</SwiperSlide>
          <SwiperSlide>Slide 9</SwiperSlide>
        </Swiper>
      </div>
    </section>
  );
}
